for nData     = 1:2
    load([TempDatDir 'ResultsCompiled_' dataSetNames{nData} '.mat'], 'analysisMat')
    X             = reshape([analysisMat.pCa0], 30, 30);
    Y             = reshape([analysisMat.pTaud], 30, 30);
    
