    colorbar
    % plot(55, 55, '*k')
    hold off
    box off
    xlim([0 100])
    ylim([0 100])
    xlabel('Frac. Nonlinearity')
    ylabel('Frac. \tau_d')
    set(gca, 'TickDir', 'out')


    Z             = [analysisMat.peakiness];
    disp(mean(Z'))
    disp(std(Z'))
    subplot(1, 3, 3)
