    colormap(french(128, 2))
    caxis([-0.2 0.2])
    set(h, 'EdgeColor', 'none');
    colorbar
    box off
    xlim([0 100])
    ylim([0 100])
    xlabel('Frac. Nonlinearity')
    ylabel('Frac. \tau_d')
    set(gca, 'TickDir', 'out')
    setPrint(8*4, 6, ['s2c_example_' dataSetNames{nData}], 'pdf')
